import './App.css';
import './styles/styles.css'
import { useState, Fragment, useRef } from 'react';
//import Operation from './components/operations/operation'
import Action from './components/actions/action'

function App() {
  const [num, setNum] = useState();
  let number = useRef();   
  var firstNum;
  var SecondNum;
  var typeOp;
  var result;

  const handleSelectNum = (selectedNum) => {      
    setNum(selectedNum);    
    //let numOneRef = useRef(selectedNum);
  }

  const handleTypeOp = (operation) => {        
    //numA = parseFloat(number.current.value);    
    assignNumbers();   
    typeOp = operation;
  } 

  const handleResult = () => {
    //SecondNum = display.value;
    switch (typeOp) {
        case "add":
            result = parseFloat(firstNum) + parseFloat(SecondNum);
            //display.value = result.toString();
            firstNum = "";
            break;
        case "less":
            result = parseFloat(firstNum) - parseFloat(SecondNum);
            //display.value = result.toString();
            firstNum = "";
            break;
        case "mult":
            result = parseFloat(firstNum) * parseFloat(SecondNum);
            //display.value = result.toString();
            firstNum = "";
            break;
        case "div":
            if (parseFloat(SecondNum) != 0) {
                result = parseFloat(firstNum) / parseFloat(SecondNum);
                //display.value = result.toString();
                firstNum = "";
            } else {
                alert("Connot divide by zero!");
                //clearDisplay();
            }
            break;
    }
  }

  const handleClear = () => {
    setNum("");
  }

  function assignNumbers() {    
    if (!firstNum) {          
      firstNum = num;
    } else {          
      SecondNum = num;
    }

    if(typeOp){
      firstNum = num;    
    }else{
      SecondNum = num;
      switch (typeOp) {
        case "add":
          result = parseFloat(firstNum) + parseFloat(SecondNum);
          firstNum = result.toString();
          break;
        case "less":
          result = parseFloat(firstNum) - parseFloat(SecondNum);
          firstNum = result.toString();
          break;
        case "mult":
          result = parseFloat(firstNum) * parseFloat(SecondNum);
          firstNum = result.toString();
          break;
        case "div":
          result = parseFloat(firstNum) / parseFloat(SecondNum);
          firstNum = result.toString();
          break;
        case "percentage":
          result = parseFloat(firstNum) * parseFloat(SecondNum) / 100;
          firstNum = "";
          break;
      }
    }
  }

  return (
    <Fragment>
      <div className="border">
        <div>
          <textarea readOnly value={num} ref={number}></textarea>
        </div>
        <div>
          <Action act="%"></Action>
          <button onClick={handleClear}>CE</button>
          <button onClick={handleClear}>C</button>
          <button onClick={handleTypeOp('div')}>/</button>
        </div>
        <div>
          <button onClick={() => handleSelectNum('7')}>7</button>
          <button onClick={() => handleSelectNum('8')}>8</button>
          <button onClick={() => handleSelectNum('9')}>9</button>
          <button onClick={handleTypeOp('mult')}>*</button>
        </div>
        <div>
          <button onClick={() => handleSelectNum('4')}>4</button>
          <button onClick={() => handleSelectNum('5')}>5</button>
          <button onClick={() => handleSelectNum('6')}>6</button>
          <button onClick={handleTypeOp('less')}>-</button>
        </div>
        <div>
          <button onClick={() => handleSelectNum('1')}>1</button>
          <button onClick={() => handleSelectNum('2')}>2</button>
          <button onClick={() => handleSelectNum('3')}>3</button>
          <button onClick={handleTypeOp('add')}>+</button>
        </div>
        <div>
          <Action act="+/-"></Action>
          <button onClick={() => handleSelectNum('0')}>0</button>
          <Action act="."></Action>
          <button onClick={handleResult}>=</button>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
